import React from 'react';
import ReactDOM from 'react-dom';
import Lic from './lic_page';
//import Global from '../App';

class Home extends React.Component {

  lic = () => {

   ReactDOM.render(<Lic />, document.getElementById('door'));
   var global = document.getElementById('global');
   global.style.background = "#67a5ad";

  }

  render() {

    return (
     <div id="door">
      <p>home page</p>
      <button onClick={this.lic} id="lic_button">click me</button>
     </div>
    );
  }

}

export default Home;
